import React, { Component } from 'react';
import { Collapse, Form, Button, Tabs, Layout, Input, Row, Col, DatePicker, Radio, Card, Select, Upload, message, Icon } from 'antd';
import moment from 'moment';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';


class timesheet extends Component {
    render() {
        return (
            <table className="table table-hover">
                <thead>

                    <tr>
                        <th>Week</th>
                        <th>{this.state.timesheet}</th>
                        <th>Tue</th>
                        <th>Wed</th>
                        <th>Thur</th>
                        <th>Fri</th>
                        <th>Sat</th>
                        <th>Sun</th>
                        <th>TotalHr</th>
                    </tr>

                </thead>
                <tbody>
                    <tr>
                        <td>Hour Claim</td>
                        <td>
                            <Input size="small" placeholder="Enter Hr" />
                        </td>


                    </tr>
                    <tr>
                        <td>Start Time</td>
                        <td><Input size="small" placeholder="Enter Start Time" /></td>
                    </tr>
                    <tr>
                        <td>Time Off</td>
                        <td><Input size="small" placeholder="Enter Time Off" /></td>
                    </tr>
                    <tr>
                        <td>Total Bill</td>
                        <td></td>
                    </tr>
                    <tr>
                        <td>Total Hours</td>
                        <td></td>
                    </tr>
                    <tr>
                        <td><Button type="primary">Save</Button></td>
                        <td><Button type="primary">Reset</Button></td>
                    </tr>

                </tbody>

            </table>
        );
    }

}

function mapStateToProps(state) {
    return {
        timesheet: state.timesheet
    };
}


export default connect(mapStateToProps)(timesheet);
